function App(){

  const [data, setBackEndData] = useState([{}])

  useEffect(() => {
    fetch("/").then(
      response => response.json()
    ).then(
      data => {
        setBackEndData(data)
      }
    )
  }, []) 

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="login" element={<Login/>} />
        <Route path="register" element={<Register/>}/>
        <Route path="settings" element={<Settings/>}/>
      </Routes>
    </BrowserRouter>
  )
}

export default App;
